import unittest
import src.connect.spprams as spprams
import src.creator.mix as mix

class TestMix(unittest.TestCase):

    global sp
    sp = spprams.sp


    def test_randPlist(self):
        # Test for creation & explicit check & Dup check
        
        plists = plistLists()

        results = mix.randPlist(plists.plists) #63 songs
        message = "An error has occurred"
        self.assertTrue(len(results) == 63, msg = message)


    def test_dailymix(self):
        # Test for creation & explicit check

        message = "An error has occurred"
        self.assertTrue(True, msg = message)


